import React from "react";
import SearchIcon from "@mui/icons-material/Search";

function All() {
  return (
    <div className="absolute top-[55px] left-[251px] w-[1219px] flex p-5 justify-between">
      {/* All header */}
      <div className="relative flex w-full justify-between px-2">
        <div className="flex">
          <span className="font-bold">전체메일</span>{" "}
          <span className="text-[#0173E5]">0</span>
          <span className="text-[#767678]"> / 163</span>
        </div>
        <div className="w-[240px] h-[30px] p-2 rounded-[15px] flex items-center bg-[#F0F1F6]">
          <input
            className="bg-[#F0F1F6] text-[14px] h-full"
            placeholder="메일검색"
          />
          <SearchIcon
            className=" border-r-[1px] border-gray-400"
            sx={{ color: "gray", fontSize: 20 }}
          />
        </div>
      </div>
    </div>
  );
}

export default All;
